//import "../CartWidget/CartWidget.jsx";
import CartWidget from "../CartWidget/CartWidget.jsx";
import './ShopCont.css';

const ShopCont = () => {
  return (
    <div class="ShopContenedor">
      <CartWidget nombreP="Yerba Serena CANARIAS 1 Kg" descP="yerba Canarias con un fino equilibrio de las hierbas" precioP="213" imgP="https://prod-resize.tiendainglesa.com.uy/images/large/P042940-1.jpg?20220111155842,Yerba-Serena-CANARIAS-1-Kg-en-Tienda-Inglesa"/>
      <CartWidget nombreP="Agua Mineral Natural sin Gas SALUS 6.25 L" descP="Agua Salus identidad de los uruguayos, con más de 120 años de trayectoria." precioP="129" imgP="https://prod-resize.tiendainglesa.com.uy/images/large/P113618-1.jpg?20230118210021,Agua-Mineral-Natural-sin-Gas-SALUS-6.25-L-en-Tienda-Inglesa"/>
      <CartWidget nombreP="Nuggets de Pollo Crocantes SADIA 900 gr" descP="sin informacion adicional" precioP="315" imgP="https://prod-resize.tiendainglesa.com.uy/images/large/P414560-1.jpg?20200203133814,Nuggets-de-Pollo-Crocantes-SADIA-900-gr-en-Tienda-Inglesa"/>
      <CartWidget nombreP="Palta Hass (por Unidad)" descP="Fruta de excelente calidad, sin fibra, alta resistencia al transporte y larga vida poscosecha." precioP="55" imgP="https://prod-resize.tiendainglesa.com.uy/images/large/P032248-1.jpg?20221104104756,Palta-Hass-por-Unidad-en-Tienda-Inglesa"/>
      <CartWidget nombreP="Arroz BLUE PATNA 1 Kg" descP="sin informacion adicional" precioP="67" imgP="https://prod-resize.tiendainglesa.com.uy/images/large/P000208-1.jpg?20191127105540,Arroz-BLUE-PATNA-1-Kg-en-Tienda-Inglesa"/>
      <CartWidget nombreP="El Azúcar Blanco Refinado es obtenido a partir de la plantación de caña de azúcar en Bella Unión." descP="El Azúcar Blanco Refinado es obtenido a partir de la plantación de caña de azúcar en Bella Unión." precioP="57" imgP="https://prod-resize.tiendainglesa.com.uy/images/large/P000163-1.jpg?20200709110051,Azucar-BELLA-UNI%C3%93N-Blanco-1Kg-en-Tienda-Inglesa"/>
      <CartWidget nombreP="Dulce de Leche CONAPROLE Clásico 500 gr" descP="ings:Leche entera pasteurizada, azúcar, almidón de maíz, conservador: sorbato de potasio (INS 202). Apto para celíacos." precioP="138" imgP="https://prod-resize.tiendainglesa.com.uy/images/large/P014587-1.jpg?20220705194926,Dulce-de-Leche-CONAPROLE-Clasico-500-gr-en-Tienda-Inglesa"/>
      <CartWidget nombreP="Vino Tinto CONCHA Y TORO Cabernet Sauvignon Reservado 750 ml" descP="Color Rojo rubí, con notas violáceas. Aroma Aroma frutal con notas a ciruelas rojas, chocolate y un leve toque vegetal." precioP="298" imgP="https://prod-resize.tiendainglesa.com.uy/images/large/P067225-1.jpg?20210701173132,Vino-Tinto-CONCHA-Y-TORO-Cabernet-Sauvignon-Reservado-750-ml-en-Tienda-Inglesa"/>
    </div>
  );
}

export default ShopCont;
